def selectionSortRe(l):
	#print('l',l)
	if(l==1):
		return
	else:
		for i in range(0,l-1):
			if(arr[i]>arr[i+1]):
				arr[i],arr[i+1] = arr[i+1], arr[i]
		selectionSortRe(l-1)

